import { IPagination, IReceive } from "@interfaces";
import axiosClient from "./axiosClient";

export const freePointApi = {
    getPreviewFreePoint: (id: string) => {
        const url = `/free-points/${id}/qrcode`;
        return axiosClient.get(url);
    },
};
